import React from "react";

const App = () => {
  return (
    <>
      <div className="main_div">
        <div className="center_div">
          <div className="search">
            <input
              type="search"
              alt="cityname"
              placeholder="Enter City Name"
              className="seacrhbar"
            />
          </div>
          <div className="temp_info">
            <h1 className="location">0 degree</h1>
            <h2 className="degree"> 5.52&deg</h2>
            <h3 className="temp_variation"></h3>
          </div>
        </div>
      </div>
    </>
  );
};

export default App;
